VALUES ('5414807006090', 'NOUILLES AU BOEUF', 'Groentemix in wisselende verhoudingen 44% [prei, champignons 8,5%, spinazie, peultjes 5%, prinsessenbonen, rode paprika), gekookte tarwenoedels 27% (water, hard tarwegriesmieel, zonnebloemolie), water, gebakken rundvlees 9% (rundvlees* &quot;, zetmeel (aardappel, tapioca), zout, glucosestroop], sojasaus 2,5% (water, sojaboon, gegrilde tarwe, zout), suiker, specerijen (gember, chili, cayennepeper), limoensap (water, limoensap uit concentraat, citroenpulp, voedingszuur: citroenzuur, natuurlíjk limoenextract), look, maiszetmeel, zonnebloemolie, geroosterde sesamolie (sesamzaad), natuurlijk aroma (melk). Légumes en proportion variable 44% (poireaux, champignons 8,5%, épinards, mange-tout 5%, haricots verts poivrons rouges), nouilles de blé cuites 27% (eau, semoule de blé dur, huile de tournesol), eau, boeuf cuit 9% viande de boeuf, amidon (pomme de terre, tapioca), sel, sirop de glucose], sauce soja 2,5% (eau, soja, blé grillé, sel), sucre, épices (gingembre, chili, piment de cayenne), jus de citron vert (eau, jus de citron vert à base de concentré, pulpe de citron, acidifiant: acide citrique, extrait naturel de citron vert), ail, amidon de mais, huile de tournesol, huile de sésame grillée (graines de sésame), arôme naturel (lait). **Ondanks alle zorg die wij aan dit product hebben besteed, kan het voorkomen dat er zich nog een enkel botje in het product bevindt. **Bien qu\'un soin tout particulier ait été apporté à ce produit, il est possible qu\'il contienne encore quelques petits os. al 59 rée', 'https://static.openfoodfacts.org/images/products/541/480/700/6090/front_fr.15.400.jpg', '2.6', '0.5', '11', '2.7', '', '4.4', '0.58', '0.228346456692913', '', '1');

